import React from 'react'

class Lema extends React.Component {
    render (){
        return (
            <div id='lema' className='bg-blue-dark p-3'>
                <div className='container'>
                    <p className='text-align-center cl-white fw-bolder fs-28 mb-0'>"La frescura de nuestro mar en un solo lugar"</p>
                </div>
            </div>
        )
    }
}

export default Lema
